    function sortJson(json){
      var jsons = [];
      var sums = [];
      Object.keys(json).forEach(function(k){
        var name = k;
        var jsonx = {
        }
        jsonx[name] = json[k];
        jsons.push(jsonx);
        var newJson = json[k];
        index = 0;
        total = 0;
        Object.keys(newJson).forEach(function(x){
          total += parseInt(newJson[x]);
        });
        sums.push(total);
      });

      var list = [];
      for (var j = 0; j < jsons.length; j++) 
          list.push({'name': jsons[j], 'age': sums[j]});

          list.sort(function(a, b) {
          return ((a.age > b.age) ? -1 : ((a.age == b.age) ? 0 : 1));
      });

      for (var k = 0; k < list.length; k++) {
        jsons[k] = list[k].name;
        sums[k] = list[k].age;
      }

      var newJson = {};
      for(var i = 0; i < jsons.length; i++){
        Object.keys(jsons[i]).forEach(function(k){
          newJson[k] = jsons[i][k];
        });
      }

      return newJson;

    }

